import React from "react";
import "./App.css";
import { Route, Link } from "react-router-dom";
import HomeePage from "./pages/homepage/homepage.component";

const HomePage = props => {
  console.log(props);
  return (
    <div>
      <button onClick={() => props.history.push("/topics/:topicId")}>*</button>{" "}
      <h1>Home Page</h1>
    </div>
  );
};

const TopicList = props => {
  console.log(props);

  return (
    <div>
      <h1>Topic List page</h1>
      <Link to={`${props.match.url}/13`}>to 13</Link>
      <Link to={`${props.match.url}/14`}>to 14</Link>
      <Link to={`${props.match.url}/15`}>to 15</Link>
    </div>
  );
};

const TopicDetail = props => {
  console.log(props);

  return (
    <div>
      <h1>Topic Detail Page</h1>
    </div>
  );
};

function App() {
  return (
    <div>
      <Route exact path="/" component={HomePage} />
      <Route path="/topics" component={TopicList} />
      <Route path="/topics/:topicId" component={TopicDetail} />
    </div>
  );
}

export default App;
